// Solution 1:
const fillMissingLetter = (arr) => {
    let missingChar = '';
    for(let i=0; i<arr.length-1; i++){
        if(arr[i]!== arr[i+1]){
            missingChar = arr[i];
            break;
        }
    }
    return [...arr].map((char, idx)=>idx===arr.lastIndexOf(missingChar)? char : missingChar);
}

